import React from 'react';
import logo from './logo.svg';
import './App.css';
import ReactDom from 'react-dom'
function MyInfo(){
  return(
  <div classname="MyInfo">
    <header className="MyInfo-header">
      <h1>Синчура Мария</h1>
      <p>Меня зовут Синчура Мария Вячеславовна.Я родилась 15 мая 2000 года</p>
      <p>Родилась и проживаю в городе Харьков.Я студентка Харьковского авиационного университета им М.Е Жуковского .Мне нравятся предметы связанные с программированием.Хочу в дальнейшем заниматься".net"разработкой.Хочу посетить известные достопримечательности разных стран. </p>
    <p>Страны в которых я хочу побывать:</p>
    <ul>
      <li>Чехия</li>
      <li>Америка</li>
      <li>Япония</li>
    </ul>
    </header>
  </div>
  )
  }
function App() {
  ReactDOM.render(
    <MyInfo />,
    document.getElementById("root")
    )
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
